import "./App.css";
import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [data2, setData] = useState("updated");

  useEffect(() => {
    axios
      .get("/")
      .then((response) => {
        JSON.parse(response);
      })
      .then((data) => {
        setData(data);
        console.log(data);
      });
  }, []);

  return (
    <div className="App">
      <header></header>
      <body>
        <p>{data2}</p>
      </body>
    </div>
  );
}

export default App;
